Verenigde Staten
Komedie / Fantasy
95 minuten

goed

met Eva Longoria Parker, Paul Rudd en Lake Bell

Wanneer zijn mooie verloofde Kate (Eva Longoria Parker) per toeval op hun huwelijksdag komt te overlijden is Henry (Paul Rudd) 
van slag. Zijn zuster Chloe (Lindsay Sloane) spoort hem aan een medium te raadplegen om met Kate's geest te kunnen praten. 
Henry valt al snel voor de knappe medium Ashley (Lake Bell). Henry is niet overtuigd van haar kwaliteiten maar de liefde is 
wederzijds. Er is echter een kaper op de kust: de geest van Kate waart nog steeds rond op aarde en het is nog maar de vraag of 
deze de pas opgebloeide liefde tussen de twee kan verdragen.
